import React from 'react';
import asignaturas from './Asignaturas.json'

const SelectAsignaturas = (props) => {
    let materias = asignaturas.map((ramo, i) => {
        return(
            <option value={ramo}>{ramo}</option>
        );
    })
    return(
        {materias}
    );
}

export default SelectAsignaturas;
